// Home.js
import React from 'react';

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-text">
        <h2>Home</h2>
        <p>Welcome to my portfolio home page!</p>
      </div>
      <div className="home-image">
        <img src="hero.png" alt="Parallax Effect" />
      </div>
    </div>
  );
};

export default Home;
